result:
query {
  enhancement:allContentfulProject(order: ASC, limit: 5, filter:{status:{contains:"Current"},category:{contains:"Enhancement"}}) {
    edges {
      node {
        id
        projectName
        slug
        territory
        phone
        email
        category
        status
      }
    }
  },
    assessment:allContentfulProject(order: ASC, limit: 5, filter:{status:{contains:"Current"},category:{contains:"Assessment"}}) {
    edges {
      node {
        id
        projectName
        slug
        territory
        phone
        email
        category
        status
      }
    }
  }
}
